    Paypal_payment_not_completed_explained: "Moguci razlozi nedovrsene PayPal uplate:<br><b>echeck</b>: Uplata ceka jer je placeno s eCheck koji jos nije proveren.<br><b>intl</b>: Uplata stoji jer prodavac poseduje racun koji nije U.S.A. i nema mogucnost podizanja novca. Prodavac mora rucno odobriti ili odbiti ovu transakciju.<br><b>multi-currency</b>: Prodavac nema stanje za valutu koju ste poslali. Prodavac mora rucno odobriti ili odbiti ovu transakciju.<br><b>unilateral</b>: Uplata stoji jer je bila upucena na email adresu koja jos nije registrirana ili proverena.<br><b>upgrade</b>: Uplata stoji jer je bila upucena s kreditne kartice, prodavac mora nadograditi svoj racun na Business ili Premier status da primi sredstva. <br><b>verify</b>: Uplata stoji jer prodavac jos nije proveren. Prodavac mora proveriti svoj racun prije nego sto moze prihvatiti uplatu.<br><b>other</b>: Uplata stoji zbog razloga koji nije utvdjen. Za vise informacija, kontaktirajte PayPal Customer Service.<br><b>Denied</b>: Prodavac je odbio primiti ovu uplatu."
